import logo from "./logo.svg";
import "./App.css";
import  { MyButton } from "./MyButton"; "./MyButton"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <MyButton />
    </div>
  );
}

export default App;
